SELECT generico_5.anunciante AS datos_copia,   MAX(generico_5.vehiculo) AS tempattrvehiculonk16626454430,   MIN(generico_5.vehiculo) AS tempattrvehiculonk5366548160,   CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) AS mnfechaok,   SUM(CAST(generico_5.numanuncios AS LONG)) AS sumnumanunciosok,   CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) AS yrfechaok FROM generico_5 WHERE ((generico_5.anunciante IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (((CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) >= 2) AND (CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) <= 12)) OR (CAST(EXTRACT(MONTH FROM generico_5.fecha) AS LONG) IS NULL)) AND (CAST(EXTRACT(YEAR FROM generico_5.fecha) AS LONG) = 2015) AND (generico_5.medio = 'TELEVISION NACIONAL')) GROUP BY generico_5.anunciante,   mnfechaok,   yrfechaok;
